import styles from "../styles/Home.module.css";
import { useRouter } from "next/router";
import { motion } from "framer-motion";
import Link from "next/link";

export default function Project() {
  const {
    query: { project },
  } = useRouter();


  return (
    <div className={styles.container}>
      <motion.h1 layoutId="header">{project}</motion.h1>
      <Link href="/">
        <a>

        <motion.div className={styles["big-image"]} style="position: relative; padding-bottom: 62.5%; height: 0;"><iframe src={project === "midori" ? "https://www.loom.com/share/90888d767bcd49799320cf5e0ab04da9" : "https://www.loom.com/embed/38a9322267054843adb08ec95c7e5e87"} frameborder="0" webkitallowfullscreen mozallowfullscreen allowfullscreen style="position: absolute; top: 0; left: 0; width: 100%; height: 100%;"></iframe></motion.div>

          {/* <motion.img
            layoutId={project}
            className={styles["big-image"]}
            src={project + ".png"}
          /> */}
        </a>
      </Link>
    </div>
  );
}
